PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE entries (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    headword TEXT NOT NULL,
                    part_of_speech TEXT,
                    source_language TEXT,
                    target_language TEXT,
                    definition_language TEXT,
                    has_context BOOLEAN DEFAULT 0,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, context_sentence TEXT,
                    UNIQUE(headword, source_language, target_language, definition_language)
                );
CREATE TABLE meanings (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    entry_id INTEGER,
                    definition TEXT,
                    noun_type TEXT,
                    verb_type TEXT,
                    comparison TEXT,
                    FOREIGN KEY(entry_id) REFERENCES entries(id) ON DELETE CASCADE
                );
CREATE TABLE examples (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    meaning_id INTEGER,
                    sentence TEXT,
                    translation TEXT,
                    is_context_sentence BOOLEAN DEFAULT 0,
                    FOREIGN KEY(meaning_id) REFERENCES meanings(id) ON DELETE CASCADE
                );
CREATE TABLE lemma_cache (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    word TEXT NOT NULL,
                    lemma TEXT NOT NULL,
                    target_language TEXT NOT NULL,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    UNIQUE(word, target_language)
                );
CREATE TABLE sentence_contexts (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    entry_id INTEGER,
                    sentence TEXT NOT NULL,
                    selected_text TEXT NOT NULL,
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    FOREIGN KEY(entry_id) REFERENCES entries(id) ON DELETE CASCADE
                );
DELETE FROM sqlite_sequence;
CREATE INDEX idx_headword ON entries(headword);
CREATE INDEX idx_source_language ON entries(source_language);
CREATE INDEX idx_target_language ON entries(target_language);
CREATE INDEX idx_definition_language ON entries(definition_language);
CREATE INDEX idx_lemma_word ON lemma_cache(word, target_language);
CREATE INDEX idx_entry_sentence ON sentence_contexts(entry_id);
CREATE INDEX idx_has_context ON entries(has_context);
CREATE INDEX idx_context_sentence ON entries(context_sentence);
CREATE INDEX idx_is_context_sentence ON examples(is_context_sentence);
COMMIT;
